import React, { Component } from "react";
import "materialize-css/dist/css/materialize.min.css";
import M from "materialize-css/dist/js/materialize.min.js";

class Broodje extends Component {
  state = {};
  componentDidMount() {
    M.AutoInit();
  }
  render() {
    return (
      <div className="container">
        <h3>Extra</h3>
        <div className="input-field col s12">
          <select defaultValue="">
            <option value="" disabled>
              Flesje drinken
            </option>
            <option value="1">Sinaasappelsap</option>
            <option value="2">Appelsap</option>
            <option value="3">Water</option>
            <option value="4">Geen</option>
          </select>
        </div>
        <div className="input-field col s12">
          <select defaultValue="">
            <option value="" disabled>
              Fruit
            </option>
            <option value="1">Appel</option>
            <option value="2">Banaan</option>
            <option value="3">Sinaasappel</option>
            <option value="4">Geen</option>
          </select>
        </div>
        <div className="input-field col s12">
          <select defaultValue="">
            <option value="" disabled>
              Extra
            </option>
            <option value="1">Sultana</option>
            <option value="2">Peperkoekreep</option>
            <option value="3">Gekookt Ei</option>
            <option value="4">Geen</option>
          </select>
        </div>
      </div>
    );
  }
}

export default Broodje;
